impl From<u16> for Php {
    #[inline(always)]
    fn from(x: u16) -> Self {
        num::FromPrimitive::from_u16(x).unwrap_or(Self::Error)
    }
}

// Php == u16
impl PartialEq<u16> for Php {
    #[inline(always)]
    fn eq(&self, x: &u16) -> bool {
        *self == Into::<Self>::into(*x)
    }
}

// u16 == Php
impl PartialEq<Php> for u16 {
    #[inline(always)]
    fn eq(&self, x: &Php) -> bool {
        *x == *self
    }
}
